import React, { Fragment } from 'react';
import logo from './Assets/pngIcons/BASALT_master_main.png';

import './navBar.scss';

const NavBar = () => {
  return (
    <Fragment>
      <img src={logo} alt="Basalt Logo" />
      <div className="navigation-routes">
        <p>home</p>
        <p>phone</p>
        <p>et</p>
      </div>
    </Fragment>
  );
};

export default NavBar;
